import * as nodeActions from "../actions/types/node-types";

const INITIAL_STATE = {
    start_coordinates: [2, 2],
    end_coordinates: [3, 3],
    additional_destination_coordinates: [[]],
    wall_coordinates: [[]],
    weight_coordinates: [[]],

}

export default function reducer(state = INITIAL_STATE, action) {

    if (action.type === nodeActions.MOVED_START) {
        return { ...state, start_coordinates: action.payload.start_coordinates }
    }
    return state;
}
